import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { Auth } from "aws-amplify";
import FacebookLogin from "react-facebook-login";

const User_login = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const navigate = useNavigate();

  const responseFacebook = (response) => {
    const { email, name, id } = response;
    // Facebook uses 'name' instead of 'first_name' and 'last_name'
    // You can also use 'id' as a unique identifier for the user
    // However, please be aware that 'email' may not always be available
    Auth.federatedSignIn(
      "facebook",
      { token: response.accessToken, expires_at: response.expiresIn },
      { name, email } // You can add more attributes here
    )
      .then((user) => {
        console.log("Successfully signed in user:", user);
        navigate("/User_dashboard");
      })
      .catch((err) => {
        console.log("Error signing in user:", err);
      });
  };

  const onSubmit = (event) => {
    event.preventDefault();

    // Authenticate the user with the Amplify Auth service
    Auth.signIn(email, password)
      .then((data) => {
        console.log("Successfully signed in user:", data);
        navigate("/User_dashboard");
      })
      .catch((err) => {
        console.log("Error signing in user:", err);
      });
  };

  return (
    <div>
      <form onSubmit={onSubmit}>
        <label htmlFor="email">Email</label>
        <input
          value={email}
          onChange={(event) => setEmail(event.target.value)}
          type="email"
          id="email"
        />
        <label htmlFor="password">Password</label>
        <input
          value={password}
          onChange={(event) => setPassword(event.target.value)}
          type="password"
          id="password"
        />
        <button type="submit">Login</button>
      </form>
      <FacebookLogin
        appId="your-app-id"
        autoLoad={true}
        fields="name,email"
        callback={responseFacebook}
      />
    </div>
  );
};

export default User_login;

